import logo from './logo.svg';
import './App.css';
import { FaPlus } from "react-icons/fa";
function App() {
  return (
    <div className="wrapper">
      <h1>Hello </h1>
    </div>
  );
}
function card() {
  return (
    <div className='card'>
      <div className='card_body'>
        <img src='\Customer Engagementfirst_img.png' />
        <h2 className='card_title'>
          Customer Engagement
        </h2>
        <p className='card_price'>
          100 DTSU*
        </p>
        <FaPlus />
      </div>
    </div>
  );
}
export default card;
